import React, { useState } from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';  // Removed BrowserRouter
import { Login } from './Login/Login';
import { Signup } from './Signup/Signup';
import { Home } from './Home/Home';
import { Navbar } from './Navbar/Navbar';
import { Footer } from 'c:/Users/hp/Desktop/Food-Donation-and-Distribution-Management-System/client/src/footer/';  // Updated import path

function App() {
  const [loginVisible, setLoginVisible] = useState(false);
  const [signupVisible, setSignupVisible] = useState(false);
  const [loginSiginin, setLoginSiginin] = useState(true);

  return (
    <div className="App">
      <Navbar loginSiginin={loginSiginin} setLoginVisible={setLoginVisible} setSignupVisible={setSignupVisible} />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login setLoginVisible={setLoginVisible} setLoginSiginin={setLoginSiginin} />} />
        <Route path="/signup" element={<Signup setSignupVisible={setSignupVisible} setLoginSiginin={setLoginSiginin} />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
